INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0.029, 122601, 1, 105, 1, 1.5, 0, 101, 160, 1, 0, 110, 1);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 0.014, 122401, 2, 111, 0, 2.5, 0, 102, 120, 3, 1, 105, 2);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0.017, 122501, 3, 105, 0, 2.5, 1, 103, 350, 2, 0, 110, 3);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 0.016, 107501, 4, 105, 0, 1.5, 0, 104, 130, 3, 1, 110, 4);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0.014, 107601, 5, 105, 1, 2.5, 0, 105, 160, 1, 0, 110, 5);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0.029, 107801, 6, 103, 0, 3.5, 1, 106, 255, 2, 0, 120, 6);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0.013, 110601, 7, 103, 1, 3.5, 0, 107, 160, 1, 0, 120, 7);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0.014, 110401, 8, 103, 0, 2.5, 1, 108, 350, 2, 0, 110, 8);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 0.012, 110501, 9, 100, 0, 1.5, 0, 109, 130, 3, 1, 105, 9);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0.014, 115701, 10, 103, 1, 2.5, 0, 110, 200, 1, 0, 105, 10);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0.071, 113601, 11, 103, 0, 2.5, 1, 111, 350, 2, 0, 105, 11);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 0.014, 107901, 12, 103, 0, 1.5, 0, 112, 130, 3, 1, 120, 12);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0.022, 108001, 13, 105, 1, 1.5, 0, 113, 200, 2, 0, 110, 13);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0.031, 110301, 14, 108, 1, 2.5, 0, 114, 160, 1, 0, 110, 14);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0.036, 107701, 15, 105, 0, 0.5, 0, 115, 130, 1, 1, 110, 15);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0.048, 113101, 16, 95, 0, 3.5, 1, 116, 350, 2, 0, 110, 16);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 0.043, 113301, 17, 105, 0, 1.5, 0, 117, 130, 3, 1, 105, 17);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 0.018, 113201, 18, 95, 0, 1.5, 0, 118, 130, 2, 1, 105, 18);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0.021, 117001, 19, 108, 1, 2.5, 0, 119, 160, 2, 0, 110, 19);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0.036, 113501, 20, 105, 0, 2.5, 1, 120, 255, 1, 0, 110, 20);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0.02, 113401, 21, 105, 0, 2.5, 1, 121, 350, 3, 0, 105, 21);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 0.018, 110101, 22, 105, 0, 2.5, 0, 122, 130, 1, 1, 110, 22);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0.03, 110001, 23, 111, 1, 3.5, 0, 123, 160, 3, 0, 105, 23);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 0.027, 117201, 24, 103, 0, 1.5, 0, 124, 130, 1, 1, 110, 24);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0.02, 117301, 25, 108, 1, 3.5, 0, 125, 160, 2, 0, 105, 25);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0.04, 117401, 26, 105, 0, 2.5, 1, 126, 350, 3, 0, 110, 26);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0.009, 117101, 27, 105, 0, 3.5, 1, 127, 350, 1, 0, 110, 27);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0.022, 122901, 28, 105, 0, 3.5, 1, 128, 255, 1, 0, 120, 28);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 0.028, 122801, 29, 105, 0, 2.5, 0, 129, 130, 3, 1, 110, 29);
INSERT INTO `v1_4208afa062f1912cad2df581f16a32085775f1cf5dc089060df51e9b91fcc57b` VALUES ("海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0.023, 122701, 30, 108, 1, 3.5, 0, 130, 130, 2, 0, 105, 30);
